import React from "react";
import styles from "./CardInfo.module.css";

export default function CardInfo({ header, text, link, extraClass }) {
  let divClass = `${extraClass} inlineBlock`;
  return (
    <div className={divClass}>
      <h2 className={styles.extraInfoHeader}>{header}</h2>
      <p className={styles.extraInfoText}>
        {text}
        {"\n"}
        {link}
      </p>
    </div>
  );
}
